def generate_max_zero_binary_string(s: str) -> str:
    n = len(s)
    s = s - '1'
    s_count = [0] * (n + 1)
    for q in range(n - 1, -1, -1):
        s_count[q] = s_count[q + 1]
        if s[q] == '1':
            s_count[q] += 1
    d = [0] * (n + 1)
    for q in range(n - 1, -1, -1):
        d[q] = max(s_count[q], d[q + 1])
        if s[q] == '0':
            d[q] = max(d[q], d[q + 1] + 1)
    t = []
    for q in range(n):
        if s[q] == '0':
            t.append('0')
        elif d[q] == d[q + 1] + 1:
            t.append('0')
        else:
            t.append('1')
    return ''.join(t)

